import {
  Container,
  BreadcrumbItem,
  Row,
  Col,
  Breadcrumb,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button,
  Form,
  FormInput,
  FormGroup,
  Collapse,
  Badge
} from "shards-react";
import Collapsible from "react-collapsible";

import { Tab, Tabs, TabContent } from "react-bootstrap";
import uuidv4 from "uuid";
import Head from "next/head";
import ListeningLayout from "../../listening-components/ListeningLayout";

import PDFFile from "../../common/PDFFile";

// Layout
import Layout from "../../components/Layout";
import SEO from "react-seo-component";

const numberOfQuestions = 6;

const LaCaseIdeal = props => (
  <Layout>
    <SEO
      title={"Spanish Curse Words - Listening Exercise | CXC Spanish Online"}
      description={
        "Practice your Spanish listening with these curse words. Pass your CXC Spanish exam with our free online study guide."
      }
      twitterUsername={"_rxhem"}
      author={"Raheem McDonald"}
      article={true}
      publishedDate={Date.now()}
      modifiedDate={Date.now()}
    />

    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <a href="/listening">Listening Exercises</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>La Casa Ideal</BreadcrumbItem>
      </Breadcrumb>

      <ListeningLayout>
        <Card>
          <CardBody>
            <CardTitle>La Casa Ideal</CardTitle>
            <p>
              Kelly is talking to Ronaldo are about a series of events that took
              place at her home. Let's hear what they are.
            </p>
            <br />
            <div className="audio">
              <h6>Normal Speed</h6>
              <audio controls>
                <source src="https://dl.dropbox.com/s/65jy2x4rrxh11fz/la-casa-ideal.mp3?dl=0" />
              </audio>
            </div>

            <br />
            <PDFFile title="La Casa Ideal" download href="" />
          </CardBody>
        </Card>
      </ListeningLayout>
    </Container>
  </Layout>
);

export default LaCaseIdeal;
